                "sharedSettings": "null",
                "fullDescription": "Keep your Directual apps communicating with users in real-time with our socket.io plugin. \n\nSocket.io is a JavaScript library that empowers real-time, bidirectional, and event-based communication between the browser and the server. It's a lifesaver for live app features like notifications, live chats, and other scenarios where data needs to be pushed to the browser in real-time.\n\nOur plugin puts the power of WebSockets right away. That’s how you can build super-responsive no-code apps faster than ever. Whether it's real-time notifications, building live chat modules, or incorporating other real-time interfaces, the socket.io plugin is your one-stop shop for all the above and more.\n\n![sockets demo](https://3629101420-files.gitbook.io/~/files/v0/b/gitbook-x-prod.appspot.com/o/spaces%2F-M4Nnmtk9_gFGWOddsf6%2Fuploads%2Fe167zXGlIJoMSLKQ4Khe%2Ffps_sockets.gif?alt=media&token=5725a593-7dd9-4619-91ac-9c3bac298d85)\n\n[Documentation on Socket.io](https://readme.directual.com/api-integrations/socket.io-websocket)",
